import React from 'react';

import './radarscreen.styles.css';

const arr = [[1, 2, 3, 4],[3, 6, 8, 0],['A', 'B', 'C', 'D']]

const RadarScreen = () => {
	return(
		<div className="radarscreen">
			<div className='space'>
			</div>
			{/* <div id="resizable">
			</div> */}
			<div id="grid-container">
				{arr.map((value, col) => value.map((rowVal,row) => (
					<div key={col} id={col} style={{ opacity: this.props.opacity }} >
						{rowVal}
					</div>
				)))}
			</div>
	</div>
	)
}

export default RadarScreen;
